// VARIABLES
import gitHub from '../../assets/icons/github.256x251.png';

function Footer() {
    return (
        <footer>
            <a href="https://github.com/Thierry77170?tab=repositories" 
                target="_blank" 
                rel="noopener noreferrer"
            >
                <img src={gitHub} alt="lien vers mon GitHub" />
            </a>
        </footer>
    )
}

export default Footer;
